import React from "react";
import SingupForm from "../components/SingupForm";
import Header from "../components/Header";
import Footer from "../components/Footer";

const SingupPage = () => {
  return (
    <>
    <Header/>
      <SingupForm />
      <Footer/>
    </>
  );
};

export default SingupPage;
